import React from 'react'
import Carousel from 'react-elastic-carousel'

 

function ItemCarousel() {
  return (
    <Carousel>
      {items.map(item => (
        <div key={item.id}>
          <h2>{item.content}</h2>
        </div>
      ))}
    </Carousel>
  )
}

export default ItemCarousel
